import {
  SideBarMenuButton,
  SideBarMenuName,
} from './SideBarMenuButtonStyles.elements';

import React from 'react';

const SideBarMenuItem = ({ data }) => {
  return data.map((e) => (
    <SideBarMenuButton onClick={e.onClick} key={e.name} to=''>
      <SideBarMenuName>
        {e.name}
        <>
          {e.bool ? (
            <div onClick={e.isFavorite(false)}>👍</div>
          ) : (
            <div onClick={e.isFavorite(true)}>👎</div>
          )}
        </>
      </SideBarMenuName>
    </SideBarMenuButton>
  ));
};

export default SideBarMenuItem;
